import styled from 'styled-components'

export const StyledContainer = styled.div`
   
   max-width: 100%;
   background: rgb(172,217,233);
background: linear-gradient(149deg, rgba(172,217,233,0.4822303921568627) 42%, rgba(75,75,75,0.13209033613445376) 93%);

article {
        display: flex;
   }
`
